function Projects() {
    return (
        <div className="container mt-5">
            <h1>My Projects</h1>
            <ul>
                <li>Project 1 - React Task Manager</li>
                <li>Project 2 - Full-stack eCommerce App</li>
                <li>Project 3 - AI Chatbot</li>
            </ul>
        </div>
    );
}

export default Projects;
